import "./App.css";

import React, { Component } from "react";
import Navbar from "./Components/Navbar";
import News from "./Components/News";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar> </Navbar>

          <Switch>
            <Route path="/">
              {" "}
              <News pageSize={5} country="in" category="science" />{" "}
            </Route>
            <Route path="/business">
              {" "}
              <News pageSize={5} country="in" category="business" />{" "}
            </Route>
            <Route path="/entertainment">
              {" "}
              <News pageSize={5} country="in" category="entertainment" />{" "}
            </Route>
            <Route path="/general">
              {" "}
              <News pageSize={5} country="in" category="general" />{" "}
            </Route>
            <Route path="/healthscience">
              {" "}
              <News pageSize={5} country="in" category="healthscience" />{" "}
            </Route>
            <Route path="/sports">
              {" "}
              <News pageSize={5} country="in" category="sports" />{" "}
            </Route>
            <Route path="/technology">
              {" "}
              <News pageSize={5} country="in" category="technology" />{" "}
            </Route>
          </Switch>
        </Router>
      </div>
    );
  }
}
